import s from "../lib/IconBase.es.js";
import n from "../defs/ContactlessPayment.es.js";
const e = t.forwardRef((o, a) => /* @__PURE__ */ t.createElement(s, { ref: a, ...o, weights: n }));
e.displayName = "ContactlessPaymentIcon";
const r = e;
export {
  r as ContactlessPayment,
  e as ContactlessPaymentIcon
};
